import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './Dashboard.css'; 

const Dashboard = () => {
  const [records, setRecords] = useState([]);
  const userId = '670e0bc1bdc546bac1cf87bb'; // Static userId
  const token = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VySWQiOiI2NzBlMGJjMWJkYzU0NmJhYzFjZjg3YmIiLCJpYXQiOjE3Mjg5NzcwMDgsImV4cCI6MTcyODk4MDYwOH0.kr8ckc3roiQfhnHXJYiJIby1bPArowjoYkOD2gQHkac'; // Static token

  useEffect(() => {
    const fetchRecords = async () => {
      try {
        const response = await axios.get(
          `http://localhost:5500/api/finance/records?userId=${userId}`,
          {
            headers: { Authorization: `Bearer ${token}` },
          }
        );
        setRecords(response.data);
      } catch (error) {
        console.error('Error fetching records:', error);
        alert('Failed to fetch finance records.');
      }
    };

    fetchRecords();
  }, [userId, token]);

  return (
    <div className="main-content">
      <h1>Finance Dashboard</h1>
      {records.length > 0 ? (
        <ul className="records-list">
          {records.map((record) => (
            <li key={record._id} className="record-item">
              {record.title}: ${record.amount} ({record.type})
            </li>
          ))}
        </ul>
      ) : (
        <p>No records found.</p>
      )}
    </div>
  );
};

export default Dashboard;
